      SELECT DISTINCT * FROM tab1 (FORMAT parquet) WHERE NOT ( + + col2 * + col2 ) NOT IN ( + 76, 94 - + - CAST ( col1 AS INTEGER ) / + - 33, + - col2 );
  - name: tab1

outputs:
  - name: q1680.out
    data: |
